heavyweight and have their own resources","Processes are used for multitasking, while threads are used for multithreading","Processes are created using the fork() system call, while threads are created using the pthread_create() function"],answer:"Processes are independent entities with their own memory space, while threads share the same memory space",tag:["Process","Thread","Operating System"]},{questionText:"In a relational database, what is the purpose of a foreign key constraint?",options:["To ensure that the data in a table is unique","To define a relationship between two tables by referencing a primary key in another table","To enforce data integrity by preventing the insertion of duplicate values","To optimize query performance by creating indexes on frequently accessed columns"],answer:"To define a relationship between two tables by referencing a primary key in another table",tag:["Relational Database","Foreign Key","Data Integrity"]},{questionText:"What is the difference between a static variable and a dynamic variable in programming?",options:["Static variables are declared within a function, while dynamic variables are declared outside a function","Static variables have a fixed memory address, while dynamic variables have a memory address that can change","Static variables are allocated on the stack, while dynamic variables are allocated on the heap","Static variables retain their value between function calls, while dynamic variables do not"],answer:"Static variables retain their value between function calls, while dynamic variables do not",tag:["Static Variable","Dynamic Variable","Variable Scope"]},{questionText:"What is the purpose of a mutex in multithreaded programming?",options:["To ensure that only one thread can access a shared resource at a time","To allow multiple threads to access a shared resource concurrently","To synchronize the execution of multiple threads by allowing them to wait for each other","To communicate data between different threads by passing messages"],answer:"To ensure that only one thread can access a shared resource at a time",tag:["Mutex","Multithreading","Synchronization"]},{questionText:"What is the difference between a TCP connection and a UDP connection?",options:["TCP is a connection-oriented protocol, while UDP is a connectionless protocol","TCP provides reliable data delivery, while UDP does not guarantee delivery","TCP is used for streaming applications, while UDP is used for real-time applications","TCP is more efficient than UDP, but it is also more complex"],answer:"TCP is a connection-oriented protocol, while UDP is a connectionless protocol",tag:["TCP","UDP","Network Protocols"]},{questionText:"What is the purpose of a virtual memory in operating systems?",options:["To provide a larger virtual address space than the physical memory available","To improve memory access speed by caching frequently used data","To manage the allocation of disk space for storing files","To implement a file system for organizing and accessing files"],answer:"To provide a larger virtual address space than the physical memory available",tag:["Virtual Memory","Operating System","Memory Management"]},{questionText:"In a graph, what is the difference between a depth-first search (DFS) and a breadth-first search (BFS)?",options:["DFS explores the graph in a depth-first manner, while BFS explores the graph in a breadth-first manner","DFS uses a stack to store the visited nodes, while BFS uses a queue","DFS is more efficient for finding the shortest path, while BFS is more efficient for finding all connected components","DFS is typically used for traversing a tree, while BFS is typically used for traversing a graph"],answer:"DFS explores the graph in a depth-first manner, while BFS explores the graph in a breadth-first manner",tag:["Graph","DFS","BFS","Search Algorithms"]},{questionText:"What is the difference between a compile-time error and a runtime error?",options:["Compile-time errors occur during the compilation process, while runtime errors occur during the execution of the program","Compile-time errors are caused by syntax errors, while runtime errors are caused by logical errors","Compile-time errors can be fixed by modifying the source code, while runtime errors can only be fixed by debugging the program","Compile-time errors are typically easier to identify and fix than runtime errors"],answer:"Compile-time errors occur during the compilation process, while runtime errors occur during the execution of the program",tag:["Compile-time Error","Runtime Error","Programming Errors"]},{questionText:"What is the purpose of a cache in a computer system?",options:["To store frequently used data for faster access","To manage the allocation of memory for different processes","To implement a file system for organizing and accessing files","To protect the system from unauthorized access"],answer:"To store frequently used data for faster access",tag:["Cache","Computer System","Performance Optimization"]},{questionText:"What is the difference between a synchronous and an asynchronous operation in programming?",options:["Synchronous operations block the execution of the program until they are completed, while asynchronous operations do not","Synchronous operations are typically faster than asynchronous operations, but they can block the program","Synchronous operations are used for I/O operations, while asynchronous operations are used for CPU-bound tasks","Synchronous operations are implemented using threads, while asynchronous operations are implemented using events"],answer:"Synchronous operations block the execution of the program until they are completed, while asynchronous operations do not",tag:["Synchronous Operation","Asynchronous Operation","Concurrency"]},{questionText:"What is the difference between a class and an object in object-oriented programming?",options:["Classes are blueprints for creating objects, while objects are instances of classes","Classes , while object-oriented programming languages are typically used for larger projects","Procedural programming languages are easier to learn than object-oriented programming languages"],answer:"Procedural programming languages focus on procedures and functions, while object-oriented programming languages focus on objects and classes",tag:["Procedural Programming","Object-Oriented Programming","Programming Paradigms"]},{questionText:"What is the purpose of a database management system (DBMS)?",options:["To store and manage data in a structured and organized manner","To implement a file system for organizing and accessing files","To protect the system from unauthorized access","To provide a graphical user interface for interacting with the system"],answer:"To store and manage data in a structured and organized manner",tag:["DBMS","Database Management","Data Storage"]},{questionText:"What is the difference between a primary key and a foreign key in a relational database?",options:["Primary keys are used to uniquely identify rows in a table, while foreign keys are used to define relationships between tables","Primary keys are typically integers, while foreign keys can be any data type","Primary keys are required for every table, while foreign keys are optional","Primary keys are used for indexing, while foreign keys are used for data validation"],answer:"Primary keys are used to uniquely identify rows in a table, while foreign keys are used to define relationships between tables",tag:["Primary Key","Foreign Key","Relational Database"]},{questionText:"What is the purpose of a data structure in computer science?",options:["To organize and store data in a way that allows efficient access and manipulation","To implement algorithms for solving specific problems","To provide a graphical user interface for interacting with the system","To manage the allocation of memory for different processes"],answer:"To organize and store data in a way that allows efficient access and manipu
